import React from 'react';
import { Formik, Form } from 'formik';
import InputControl from '../../components/fieldComponents/textFieldComponent';
import TextArea from "../fieldComponents/textArea";
import "./form.sass";
import {Button} from "@chakra-ui/react";
import TextComp from "../fieldComponents/textComp";


const MyForm = () => {
    return (
        <div>
            <Formik

                initialValues={{
                    name: '',
                    description: ''
                }}
                onSubmit={(values, actions) => {
                    // handle form submission
                    actions.setSubmitting(false);
                }}
            >
                {({ isSubmitting }) => (
                    <div className={"form"}>

                        <Form>
                            <InputControl label="Name" name="name"  type={"text"}/>
                            <TextArea name={"description"} label={"Description"}/>
                            <Button className={"btn"} type={"submit"} name={"Create"}>Create</Button>

                        </Form>
                    </div>

                )}
            </Formik>
        </div>

    );
};

export default MyForm;
